import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      {/* Header Navigation */}
      <header className="header">
        <div className="copyright">© Code by [Your Name]</div>
        <nav>
          <ul className="nav-links">
            <li><a href="#work">Work</a></li>
            <li><a href="#about">About</a></li>
            <li><a href="#contact">Contact</a></li>
          </ul>
        </nav>
      </header>

      {/* Hero Section */}
      <div className="hero">
        <div className="hero-content">
          <h1 className="hero-title">berg — Dennis S</h1>
          <p className="hero-subtitle">Freelance Designer & Developer</p>
        </div>
        <div className="hero-image">
          <img
            src="/Users/aniruddhkapileshwari/Desktop/Deepa-pot/deepa-portfolio/src/assets/1.png"
            alt="Hero"
          />
        </div>
      </div>

      {/* Moving Text Section */}
      <div className="moving-text">
        <p>
          Creative | Passionate | Innovative | Problem Solver | Driven
        </p>
      </div>
    </div>
  );
};

export default Home;
